import axios from 'axios';
import React from 'react'
import { useState, useEffect } from 'react';

export default function GetData() {
    const [post, setPost] = useState([]);
    useEffect(()=>{
        axios.get('https://api.github.com/users')
        .then(res => {
            console.log(res);
            setPost(res.data);
        })
        .catch(err =>{
            console.log(err);
        })
    }, []);
    return (
        <div>
            <ul>
                {
                    post.map((ele)=>{
                        return (
                            <li key ={ele.id}>
                                {ele.title}
                            </li>
                        )
                    })
                }   
            </ul>
        </div>
    )
}
